import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'


let currentDate = new Date();
let hour = currentDate.getHours();

let greeting = "";

if(hour >= 1 && hour < 12){
  greeting = "Good Morning";
}
else if(hour >= 12 && hour < 19){
  greeting = "Good Afternoon";
}
else{
  greeting = "Good Night"
}
